import React, {useState, useEffect} from "react";

function SidaSammanlagdStats({patienter}) {
  const [currentValue, setCurrentValue] = useState(0);
  const [previousValue, setPreviousValue] = useState(0);

  // Uppdatera currentValue och previousValue varje gång patienter ändras
  useEffect(() => {
    setPreviousValue(currentValue);
    setCurrentValue((prev) => prev + 1);
  }, [patienter, currentValue]);

  return (
    <div>
      <p>Nuvarande värde: {currentValue}</p>
      <p>Föregående värde: {previousValue}</p>
    </div>
  );
}

export default SidaSammanlagdStats;
